class PredictionResponse(BaseModel):
    """Pydantic model for the response payload containing the model's predictions."""
    signal_class_prediction: str = Field(
        description='The predicted class of the signal (earthquake or noise).'
    )
    signal_class_probability: float = Field(
        description=(
            'The probability of the signal being an earthquake, as predicted by the '
            'signal classification model.'
        )
    )
    earthquake_magnitude_prediction: Union[float, None] = Field(
        description=(
            'The magnitude of the earthquake predicted by the magnitude model, if the '
            'signal is predicted to be an earthquake by the classification model.'
        )
    )
    status: Optional[Union[str, None]] = Field(description='Prediction result status.')
    message: Optional[Union[str, None]] = Field(description='Error message, if an error occurred.')

    class Config:
        json_schema_extra = {
            'example': {
                'signal_class_prediction': 'earthquake',
                'signal_class_probability': 0.999945283,
                'earthquake_magnitude_prediction': 0.690547287
            }
        }